<template>
  <div>swipaer 分组</div>

  <div>
    <swiper
      :slidesPerView="3"
      :spaceBetween="30"
      :slidesPerGroup="3"
      :loop="true"
      :loopFillGroupWithBlank="true"
      :pagination="{
        clickable: true,
      }"
      :navigation="true"
      :modules="modules"
      class="mySwiper"
      @afterInit="onAfterInit"
      @slideChange="pupularHandleGameSwiperChange"
    >
      <swiper-slide v-for="item in slist" :key="item">
        <div style="height: 200px; border: 1px solid red">Slide {{ item }}</div>
      </swiper-slide>
    </swiper>
    <div style="text-align: center">第 {{ currentIndex }}页</div>
  </div>

  <button @click="login">login</button>
  <button @click="refreshNftsInWallet">
    nftWallet.refreshNftsInWallet 这是从链上同步当前账号的所有NFT的API
  </button>

  <div style="width: 200px">
    <div>无边框， 主要用于，个人页搜索，和 元宇宙详情页搜索</div>
    <SelectVue
      placeholder="Select ..."
      :options="options"
      v-model="select"
      valuekey="id"
      labelkey="name"
      @change="change"
      @clear="clear"
    ></SelectVue>
    <button @click="select = 1">设置 select 值 {{ select }}</button>

    <div>有边框</div>
    <SelectVue
      border
      placeholder="Select ..."
      :options="[1, 2, 3, 4]"
      v-model="select1"
    ></SelectVue>

    <div>可清空</div>
    <SelectVue
      border
      clearable
      placeholder="Select ..."
      :options="[1, 2, 3, 4]"
      v-model="select2"
      @change="change"
      @clear="clear"
    ></SelectVue>

    <div>带图片</div>
    <SelectVue
      border
      clearable
      placeholder="Add Item"
      :options="hasImgOptions"
      v-model="select3"
      valuekey="id"
      labelkey="name"
      imageKey="src"
      @change="change"
      @clear="clear"
    ></SelectVue>

    <div>带搜索</div>
    <SelectVue
      border
      clearable
      searchable
      placeholder="Add Item"
      :options="hasImgOptions"
      v-model="select4"
      valuekey="id"
      labelkey="name"
      imageKey="src"
      @change="change"
      @clear="clear"
    ></SelectVue>
  </div>

  <div>链交互</div>
  <div>
    <a
      href="https://rinkeby.etherscan.io/address/0xadd80Ec072506558cca3069Ab20FE463549a2699#readContract"
      target="_blank"
      >NFT合约地址</a
    >
    &emsp;
    <a
      href="https://rinkeby.etherscan.io/address/0x40eFAe212f4455bBc8eC2F53b9Bd79fCd3a84648#readContract"
      target="_blank"
      >EXCHANGE合约地址</a
    >
    <div></div>
    <button @click="doMint">NFT - mint</button>
    <button @click="balanceOf">
      NFT - balanceOf {{ balanceOfValue && "---" + balanceOfValue }}
      {{ loading }}
    </button>
  </div>

  <div>Naive UI</div>
  <div>
    <NSlider
      :theme-overrides="sliderTheme"
      v-model:value="sliderValue"
      range
      :step="1"
      :min="1"
      :max="1000"
    ></NSlider>
    <input type="text" v-model="sliderValue[0]" />
    <input type="text" v-model="sliderValue[1]" />
  </div>

